import React from 'react';
import styled from 'styled-components';
import CardComponent from './componets/Card';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";



function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<CardComponent />} />
      </Routes>
    </Router>
  );
};

export default App;
